","export interface BaseAPIOptions {
 /**
 * Waline 服务端地址
 *
 * Waline serverURL
 */
 serverURL: string;

 /**
 * 错误信息所使用的语言
 *
 * Language used in error text
 */
 lang: string;
}

export interface ErrorStatusResponse {
 /**
 * 错误代码
 *
 * Error number
 */
 errno: number;

 /**
 * 错误消息
 *
 * Error msg
 */
 errmsg: string;
}

export const JSON_HEADERS: Record<string, string> = {
 // eslint-disable-next-line @typescript-eslint/naming-convention
 'Content-Type': 'application/json',
};

export const errorCheck = <T extends ErrorStatusResponse>(
 data: T,
 name = ''
): T => {
 if (typeof data === 'object' && data.errno)
 throw new TypeError(`${name} failed with ${data.errno}: ${data.errmsg}`);

 return data;
};
","import { getArticleCounter, updateArticleCounter } from './articleCounter';
import type { BaseAPIOptions } from './utils';

interface GetPageviewOptions extends BaseAPIOptions {
 /**
 * 待获取页面的 path
 *
 * Path of pages
 */
 paths: string[];

 /**
 * 取消请求的信号
 *
 * AbortSignal to cancel request
 */
 signal?: AbortSignal;
}

export const getPageview = ({
 serverURL,
 lang,
 paths,
 signal,
}: GetPageviewOptions): Promise<number[]> =>
 getArticleCounter({
 serverURL,
 lang,
 paths,
 type: ['time'],
 signal,
 })
 // TODO: Improve this API
 .then((counts) => (Array.isArray(counts) ? counts : [counts])) as Promise<
 number[]
 >;

export interface UpdatePageviewOptions extends BaseAPIOptions {
 /**
 * 待更新页面的 path
 *
 * Path of pages
 */
 path: string;
}

export const updatePageview = (
 options: UpdatePageviewOptions
): Promise<number> =>
 updateArticleCounter({
 ...options,
 type: 'time',
 action: 'inc',
 });
","import { JSON_HEADERS } from './utils';
import type { BaseAPIOptions } from './utils';

export interface GetArticleCounterOptions extends BaseAPIOptions {
 /**
 * 待获取计数器的 path
 *
 * Path of counters
 */
 paths: string[];

 /**
 * 待获取计数器的类型
 *
 * Counter type to be fetched
 */
 type: string[];

 /**
 * 取消请求的信号
 *
 * AbortSignal to cancel request
 */
 signal?: AbortSignal;
}

export type GetArticleCounterResponse =
 | Record<string, number>[]
 | Record<string, number>
 | number[]
 | number;

export const getArticleCounter = ({
 serverURL,
 lang,
 paths,
 type,
 signal,
}: GetArticleCounterOptions): Promise<GetArticleCounterResponse> =>
 fetch(
 `${serverURL}/article?path=${encodeURIComponent(
 paths.join(',')
 )}&type=${encodeURIComponent(type.join(','))}&lang=${lang}`,
 { signal }
 ).then((resp) => <Promise<GetArticleCounterResponse>>resp.json());

export interface UpdateArticleCounterOptions extends BaseAPIOptions {
 /**
 * 待更新计数器的 path
 *
 * Path of counter to be updated
 */
 path: string;

 /**
 * 待更新计数器的类型
 *
 * Counter type to be updated
 */
 type: string;

 /**
 * 更新操作
 *
 * Update operation
 *
 * @default 'inc'
 */
 action?: 'inc' | 'desc';
}

export const updateArticleCounter = ({
 serverURL,
 lang,
 path,
 type,
 action,
}: UpdateArticleCounterOptions): Promise<number> =>
 fetch(`${serverURL}/article?lang=${lang}`, {
 method: 'POST',
 headers: JSON_HEADERS,
 body: JSON.stringify({ path, type, action }),
 }).then((resp) => <Promise<number>>resp.json());
","import {
 defaultLang,
 defaultLocales,
 defaultReaction,
 defaultUploadImage,
 defaultHighlighter,
 defaultTexRenderer,
 getDefaultSearchOptions,
 getMeta,
} from '../config';

import { decodePath, isLinkHttp, removeEndingSplash } from './path';

import type {
 WalineEmojiInfo,
 WalineEmojiMaps,
 WalineLocale,
 WalineProps,
} from '../typings';

export interface WalineEmojiConfig {
 tabs: Pick<WalineEmojiInfo, 'name' | 'icon' | 'items'>[];
 map: WalineEmojiMaps;
}

export interface WalineConfig
 extends Required<Omit<WalineProps, 'wordLimit' | 'reaction'>> {
 locale: WalineLocale;
 wordLimit: [number, number] | false;
 reaction: string[];
}

export const getServerURL = (serverURL: string): string => {
 const result = removeEndingSplash(serverURL);

 return isLinkHttp(result) ? result : `https://${result}`;
};

const getWordLimit = (
 wordLimit: WalineProps['wordLimit']
): [number, number] | false =>
 Array.isArray(wordLimit) ? wordLimit : wordLimit ? [0, wordLimit] : false;

const fallback = <T = unknown>(
 value: T | false | undefined,
 fallback: T
): T | false =>
 typeof value === 'function' ? value : value === false ? false : fallback;

export const getConfig = ({
 serverURL,

 path = location.pathname,
 lang = defaultLang,
 locale,
 emoji = ['//unpkg.com/@waline/emojis@1.1.0/weibo'],
 meta = ['nick', 'mail', 'link'],
 requiredMeta = [],
 dark = false,
 pageSize = 10,
 wordLimit,
 imageUploader,
 highlighter,
 texRenderer,
 copyright = true,
 login = 'enable',
 search,
 reaction,
 recaptchaV3Key = '',
 commentSorting = 'latest',
 ...more
}: WalineProps): WalineConfig => ({
 serverURL: getServerURL(serverURL),
 path: decodePath(path),
 locale: {
 ...(defaultLocales[lang] || defaultLocales[defaultLang]),
 ...(typeof locale === 'object' ? locale : {}),
 } as WalineLocale,
 wordLimit: getWordLimit(wordLimit),
 meta: getMeta(meta),
 requiredMeta: getMeta(requiredMeta),
 imageUploader: fallback(imageUploader, defaultUploadImage),
 highlighter: fallback(highlighter, defaultHighlighter),
 texRenderer: fallback(texRenderer, defaultTexRenderer),
 lang,
 dark,
 emoji,
 pageSize,
 login,
 copyright,
 search: search ?? getDefaultSearchOptions(lang),
 recaptchaV3Key,
 reaction: Array.isArray(reaction)
 ? reaction
 : reaction === true
 ? defaultReaction
 : [],
 commentSorting,
 ...more,
});
","export const decodePath = (path: string): string => {
 try {
 path = decodeURI(path);
 } catch (err) {
 // ignore error
 }

 return path;
};

export const removeEndingSplash = (content = ''): string =>
 content.replace(/\/$/u, '');

export const isLinkHttp = (link: string): boolean =>
 /^(https?:)?\/\//.test(link);
